	"aboutContent": "<span class=\"aboutHeader\">What is the Database of Island Invasive Species Eradications?</span><br/>Islands  are the epicenter of the current global extinction crisis and invasive  vertebrates are the leading cause of extinction on islands. Removing invasive  vertebrates from islands is a well-established tool to protect and restore  island ecosystems and prevent extinctions.<p>The  Database  of  Island Invasive Species Eradications compiles all of the historical and current invasive vertebrate eradications  on islands. Data from each project includes information on the island, methods  used in the eradication and contact information   for people knowledgeable about the eradication.</p><p>Our  hope is that the database will help by facilitating:</p><ul type=\"circle\"><li>Knowledge sharing: Improving transfer of knowledge between existing eradication practitioners, and providing contacts for each eradication to facilitate communication between experienced eradicators and those seeking assistance </li><li>Technique evaluation: Tracking eradication attempts to analyse where, how and who is undertaking these efforts, which techniques are successful and highlighting invasive species for which techniques are deficient. </li><li>Fund raising: this database is a valuable tool for fund raising by allowing practitioners to contextualize proposed island eradication projects against the global scope of this technique and historical eradication attempts. </li></ul>",
