	"noThumbnails": "No se encontraron imágenes 'thumbnail'...",
	"aboutContent": "<span class=\"aboutHeader\">Qué es la Base de Datos de Erradicaciones de Especies Invasoras?</span><br/>Las Islas son el epicentro de la actual crisis global de extinciones, siendo los vertebrados invasores la principal causa de extinciones en islas. La remoción de vertebrados invasores es una herramienta arraigada para proteger y restaurar los ecosistemas insulares y prevenir extinciones.<p>La Base de Datos de Erradicaciones de Especies Invasoras en Islas compila información histórica y actual sobre las erradicaciones de vertebrados invasores en islas. Los datos de cada proyecto incluyen información sobre la isla, métodos usados en la erradicación e información de contacto de las personas expertas en la erradicación.</p><p>Nuestra esperanza es que la base de datos facilitará:</p><ul type=\"circle\"><li>El intercambio de información: Mejorando la transferencia de conocimiento entre practicantes de métodos de erradicación. Proporcionando contactos sobre cada proyecto de erradicación para facilitar la comunicación entre erradicadores experimentados y aquellos en busca de asistencia. </li><li>Evaluación de técnicas: El seguimiento de los intentos de erradicación para analizar donde, como, y quien esta llevando a cabo estos esfuerzos; cuales técnicas son exitosas y resaltando las especies invasoras para las cuales las técnicas aún son deficientes.</li><li>Generación de fondos: Esta base de datos es una herramienta valiosa para recaudar fondos al permitirle a los practicantes conceptualizar  propuestas de proyectos de erradicacion en islas con base en un marco global de erradicaciones e información histórica sobre intentos de erradicación. </li></ul>",
